import React from "react";

const Fibonacci = () =>{

    function nFibonacci(n, arr = []) {
        

        if(n === 0 ){
            arr.push(0);
            return arr.join(', ');
        } else if( n === 1){
            arr.push(1);
            return arr.join(', ');
        } else {
            arr.push(nFibonacci(n-1, arr) + nFibonacci(n-2, arr));
            return arr.join(', ');
        }  
    }


    return(
        <div>
            <h1>Fibonacci</h1>
            <div>
                <input type="text" name="number" value=""/>
                <button>Go</button> 
            </div>
        </div>
    );
}

